"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[7520],{5388:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"guide","metadata":{"permalink":"/ask-for-information/blog/guide","source":"@site/blog/2021-04-06-guide.mdx","title":"\uae30\uc5ec\ub97c \uc704\ud55c \uac00\uc774\ub4dc","description":"\uc774 \ud504\ub85c\uc81d\ud2b8\uc5d0 \ub300\uad6c\uc18c\ud504\ud2b8\uc6e8\uc5b4\ub9c8\uc774\uc2a4\ud130\uace0\ub4f1\ud559\uad50\ub97c \uac70\uccd0\uac14\ub2e4\uba74 \ub204\uad6c\ub098 \uae30\uc5ec\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","date":"2021-04-06T00:00:00.000Z","formattedDate":"April 6, 2021","tags":[{"label":"docusaurus","permalink":"/ask-for-information/blog/tags/docusaurus"},{"label":"guide","permalink":"/ask-for-information/blog/tags/guide"},{"label":"markdown","permalink":"/ask-for-information/blog/tags/markdown"}],"readingTime":2.525,"hasTruncateMarker":false,"authors":[{"name":"Sh031224","title":"\ucc28\uc2b9\ud638","url":"https://github.com/Sh031224","imageURL":"https://avatars.githubusercontent.com/u/51149996?s=48&v=4"}],"frontMatter":{"slug":"guide","title":"\uae30\uc5ec\ub97c \uc704\ud55c \uac00\uc774\ub4dc","author":"Sh031224","author_title":"\ucc28\uc2b9\ud638","author_url":"https://github.com/Sh031224","author_image_url":"https://avatars.githubusercontent.com/u/51149996?s=48&v=4","tags":["docusaurus","guide","markdown"]},"nextItem":{"title":"\ub9c8\ud06c\ub2e4\uc6b4 \uc2a4\ud0c0\uc77c","permalink":"/ask-for-information/blog/style"}},"content":"\uc774 \ud504\ub85c\uc81d\ud2b8\uc5d0 \ub300\uad6c\uc18c\ud504\ud2b8\uc6e8\uc5b4\ub9c8\uc774\uc2a4\ud130\uace0\ub4f1\ud559\uad50\ub97c \uac70\uccd0\uac14\ub2e4\uba74 \ub204\uad6c\ub098 \uae30\uc5ec\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \ubb38\uc11c \uc218\uc815\\n\\n<span>\\n  <svg\\n    fill=\\"currentColor\\"\\n    height=\\"1.2em\\"\\n    width=\\"1.2em\\"\\n    preserveAspectRatio=\\"xMidYMid meet\\"\\n    role=\\"img\\"\\n    viewBox=\\"0 0 40 40\\"\\n    class=\\"iconEdit_node_modules-@docusaurus-theme-classic-lib-next-theme-IconEdit-\\"\\n    aria-label=\\"Edit page\\"\\n  >\\n    <g>\\n      <path d=\\"m34.5 11.7l-3 3.1-6.3-6.3 3.1-3q0.5-0.5 1.2-0.5t1.1 0.5l3.9 3.9q0.5 0.4 0.5 1.1t-0.5 1.2z m-29.5 17.1l18.4-18.5 6.3 6.3-18.4 18.4h-6.3v-6.2z\\"></path>\\n    </g>\\n  </svg>\\n  Edit this page\\n</span> \ub97c \ud074\ub9ad \uc2dc \ud574\ub2f9 \ud30c\uc77c\uc744 \uc218\uc815\ud558\ub294 <code>Github</code> \ub85c \uc774\ub3d9\ub429\ub2c8\ub2e4.\\n\\n`Github` \uc5d0\uc11c `.md` \ub610\ub294 `.mdx` \ud655\uc7a5\uc790\uc5d0 \ub9de\uac8c \ubb38\uc11c\ub97c \uc218\uc815\ud558\uc2dc\uba74 \ub429\ub2c8\ub2e4.\\n\\n\uc218\uc815\ud55c \uc774\ud6c4 `commit` \uacfc `Pull Request` \ub97c \uc0dd\uc131\ud558\uba74 \ub429\ub2c8\ub2e4.\\n\\n## \ubb38\uc11c \uc0dd\uc131\\n\\n```\\nask-for-information\\n\u251c\u2500\xa0docs\\n\u2502\xa0\xa0\u2514\u2500\xa0category\\n\u2502\xa0\xa0\xa0\xa0\xa0\u2514\u2500\xa0category2\\n\u2502\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\u2514\u2500\xa0doc.md\\n\u2514\u2500\xa0sidebars.js\\n```\\n\\n\uc6b0\ub9ac\uac00 \uc8fc\uc758\uae4a\uac8c \uc0b4\ud3b4\ubd10\uc57c \ud560 \ubd80\ubd84\uc740 <code>docs</code> \uc640 <code>sidebars.js</code> \uc785\ub2c8\ub2e4.\\n\uae30\ubcf8\uc801\uc73c\ub85c \ubaa8\ub4e0 \ubb38\uc11c\ub294 <code>docs</code> \ud3f4\ub354\uc5d0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\ub610\ud55c \ubb38\uc11c\uc5d0 \uce74\ud14c\uace0\ub9ac\uac00 \uc788\uc744 \uacbd\uc6b0 \uce74\ud14c\uace0\ub9ac \uc774\ub984\uc5d0 \ud574\ub2f9\ud558\ub294 \ud3f4\ub354\ub97c \uc0dd\uc131\ud574\uc57c\ud569\ub2c8\ub2e4.\\n\\n### \uc608\uc2dc\\n\\n```\\nask-for-information\\n\u251c\u2500\xa0docs\\n\u2502\xa0\xa0\u2514\u2500\xa0example\\n\u2502\xa0\xa0\xa0\xa0\xa0\u2514\u2500\xa0docs.md\\n\u2514\u2500\xa0sidebars.js\\n```\\n\\n### \uc791\uc131 \ubc29\ubc95\\n\\n\ud655\uc7a5\uc790\ub294 `.md` \ub610\ub294 `.mdx` \ub85c \uc791\uc131 \uac00\ub2a5\ud569\ub2c8\ub2e4.\\n\\n```markdown\\n---\\nid: (\ud30c\uc77c\uc774\ub984\uc73c\ub85c \ud1b5\uc77c)\\ntitle: (\uc81c\ubaa9)\\n---\\n```\\n\\n\ud30c\uc77c\uc758 \uc81c\uc77c \uc0c1\ub2e8 \ubd80\ubd84\uc5d0 \ud574\ub2f9 \ucf54\ub4dc\ub97c \uc0bd\uc785\ud574\uc57c\ud569\ub2c8\ub2e4.\\n\ub610\ud55c \ud30c\uc77c \uc774\ub984 \ub124\uc774\ubc0d\uc740 `snake case` \ub85c \uc0dd\uc131\ud569\ub2c8\ub2e4.\\n\\n### sidebars.js\\n\\n\uc88c\uce21\uc758 \uc0ac\uc774\ub4dc\ubc14 \uad00\ub828\uc740 `sidebars.js` \uc5d0\uc11c \ucd94\uac00\ud558\uac70\ub098 \uc218\uc815\ud574\uc57c\ud569\ub2c8\ub2e4.\\n\\n\uce74\ud14c\uace0\ub9ac \ucd94\uac00\uc2dc\\n\\n```js\\n{\\n\\ttype: \\"category\\",\\n\\tlabel: \\"name\\",\\n\\titems: [\\"name/example\\"]\\n}\\n```\\n\\n\ubd80\ubd84\uc744 \uc791\uc131\ud558\uc5ec \uce74\ud14c\uace0\ub9ac\ub97c \ucd94\uac00 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\uc911\ucca9 \uce74\ud14c\uace0\ub9ac \uc791\uc131 \uc2dc `items` \ubd80\ubd84\uc5d0 \uc704\uc640 \uac19\uc740 \ucf54\ub4dc\ub97c \ud55c\ubc88 \ub354 \uc801\uc73c\uc2dc\uba74 \ub429\ub2c8\ub2e4.\\n\\n\uce74\ud14c\uace0\ub9ac\uac00 \uc544\ub2cc \ubb38\uc11c\ub97c \ucd94\uac00\ud558\uae30 \uc704\ud574\uc11c\ub294\\n\\nex) `docs/interview/frontend.md` \ub97c \ucd94\uac00\ud558\ub824\uba74 `items: [\\"interview/frontend\\"]` \ub97c \ucd94\uac00\ud558\uba74 \ub429\ub2c8\ub2e4.\\n\\n`\\"folder/docs\'id\\"`\\n\\n```js\\nmodule.export = {\\n  docs: [\\n    // \uce74\ud14c\uace0\ub9ac \uc5c6\ub294 \uc544\uc774\ud15c\\n    \\"example\\",\\n    // \uce74\ud14c\uace0\ub9ac\\n    {\\n      type: \\"category\\",\\n      label: \\"first\\",\\n      items: [\\n        // \uc544\uc774\ud15c\\n        \\"first-example\\",\\n        // \uce74\ud14c\uace0\ub9ac\\n        {\\n          type: \\"category\\",\\n          label: \\"second\\",\\n          items: [\\"first/second/example\\"]\\n        }\\n      ]\\n    },\\n    // \uce74\ud14c\uace0\ub9ac\\n    {\\n      type: \\"category\\",\\n      label: \\"third\\",\\n      items: [\\"third/example\\"]\\n    }\\n  ]\\n};\\n```"},{"id":"style","metadata":{"permalink":"/ask-for-information/blog/style","source":"@site/blog/2021-04-05-style.md","title":"\ub9c8\ud06c\ub2e4\uc6b4 \uc2a4\ud0c0\uc77c","description":"docusaurus \uc5d0\uc11c\uc758 Markdown \uc2a4\ud0c0\uc77c\uc744 \uc704\ud55c \uac00\uc774\ub4dc\uc785\ub2c8\ub2e4.","date":"2021-04-05T00:00:00.000Z","formattedDate":"April 5, 2021","tags":[{"label":"guide","permalink":"/ask-for-information/blog/tags/guide"},{"label":"style","permalink":"/ask-for-information/blog/tags/style"},{"label":"markdown","permalink":"/ask-for-information/blog/tags/markdown"}],"readingTime":3.06,"hasTruncateMarker":false,"authors":[{"name":"Sh031224","title":"\ucc28\uc2b9\ud638","url":"https://github.com/Sh031224","imageURL":"https://avatars.githubusercontent.com/u/51149996?s=48&v=4"}],"frontMatter":{"slug":"style","title":"\ub9c8\ud06c\ub2e4\uc6b4 \uc2a4\ud0c0\uc77c","author":"Sh031224","author_title":"\ucc28\uc2b9\ud638","author_url":"https://github.com/Sh031224","author_image_url":"https://avatars.githubusercontent.com/u/51149996?s=48&v=4","tags":["guide","style","markdown"]},"prevItem":{"title":"\uae30\uc5ec\ub97c \uc704\ud55c \uac00\uc774\ub4dc","permalink":"/ask-for-information/blog/guide"}},"content":"`docusaurus` \uc5d0\uc11c\uc758 `Markdown` \uc2a4\ud0c0\uc77c\uc744 \uc704\ud55c \uac00\uc774\ub4dc\uc785\ub2c8\ub2e4.\\n\\n> \ubcf8 \ud398\uc774\uc9c0\uc5d0\uc11c\ub294 \uacb0\uacfc\ub97c,\\n> [\uc5ec\uae30](https://raw.githubusercontent.com/Sh031224/ask-for-information/master/blog/2021-04-05-style.md) \uc5d0\uc11c\ub294 \ucf54\ub4dc\ub97c \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## Headers\\n\\n# H1 - Create the best documentation\\n\\n## H2 - Create the best documentation\\n\\n### H3 - Create the best documentation\\n\\n#### H4 - Create the best documentation\\n\\n##### H5 - Create the best documentation\\n\\n###### H6 - Create the best documentation\\n\\n---\\n\\n## Emphasis\\n\\nEmphasis, aka italics, with _asterisks_ or _underscores_.\\n\\nStrong emphasis, aka bold, with **asterisks** or **underscores**.\\n\\nCombined emphasis with **asterisks and _underscores_**.\\n\\nStrikethrough uses two tildes. ~~Scratch this.~~\\n\\n---\\n\\n## Lists\\n\\n1. First ordered list item\\n1. Another item\\n   - Unordered sub-list.\\n1. Actual numbers don\'t matter, just that it\'s a number\\n   1. Ordered sub-list\\n1. And another item.\\n\\n- Unordered list can use asterisks\\n\\n* Or minuses\\n\\n- Or pluses\\n\\n---\\n\\n## Links\\n\\n[I\'m an inline-style link](https://www.google.com/)\\n\\n[I\'m an inline-style link with title](https://www.google.com/ \\"Google\'s Homepage\\")\\n\\n[I\'m a reference-style link][arbitrary case-insensitive reference text]\\n\\n[You can use numbers for reference-style link definitions][1]\\n\\nOr leave it empty and use the [link text itself].\\n\\nURLs and URLs in angle brackets will automatically get turned into links. http://www.example.com/ or <http://www.example.com/> and sometimes example.com (but not on GitHub, for example).\\n\\nSome text to show that the reference links can follow later.\\n\\n[arbitrary case-insensitive reference text]: https://www.mozilla.org/\\n[1]: http://slashdot.org/\\n[link text itself]: http://www.reddit.com/\\n\\n---\\n\\n## Images\\n\\nHere\'s our logo (hover to see the title text):\\n\\nInline-style: ![alt text](https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png \\"Logo Title Text 1\\")\\n\\nReference-style: ![alt text][logo]\\n\\n[logo]: https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png \\"Logo Title Text 2\\"\\n\\n---\\n\\n## Code\\n\\n```javascript\\nvar s = \\"JavaScript syntax highlighting\\";\\nalert(s);\\n```\\n\\n```python\\ns = \\"Python syntax highlighting\\"\\nprint(s)\\n```\\n\\n```\\nNo language indicated, so no syntax highlighting.\\nBut let\'s throw in a <b>tag</b>.\\n```\\n\\n```js {2}\\nfunction highlightMe() {\\n\\tconsole.log(\\"This line can be highlighted!\\");\\n}\\n```\\n\\n---\\n\\n## Tables\\n\\nColons can be used to align columns.\\n\\n| Tables        |      Are      |   Cool |\\n| ------------- | :-----------: | -----: |\\n| col 3 is      | right-aligned | \\\\$1600 |\\n| col 2 is      |   centered    |   \\\\$12 |\\n| zebra stripes |   are neat    |    \\\\$1 |\\n\\nThere must be at least 3 dashes separating each header cell. The outer pipes (|) are optional, and you don\'t need to make the raw Markdown line up prettily. You can also use inline Markdown.\\n\\n| Markdown | Less      | Pretty     |\\n| -------- | --------- | ---------- |\\n| _Still_  | `renders` | **nicely** |\\n| 1        | 2         | 3          |\\n\\n---\\n\\n## Blockquotes\\n\\n> Blockquotes are very handy in email to emulate reply text. This line is part of the same quote.\\n\\nQuote break.\\n\\n> This is a very long line that will still be quoted properly when it wraps. Oh boy let\'s keep writing to make sure this is long enough to actually wrap for everyone. Oh, you can _put_ **Markdown** into a blockquote.\\n\\n---\\n\\n## Inline HTML\\n\\n<dl>\\n  <dt>Definition list</dt>\\n  <dd>Is something people use sometimes.</dd>\\n\\n  <dt>Markdown in HTML</dt>\\n  <dd>Does *not* work **very** well. Use HTML <em>tags</em>.</dd>\\n</dl>\\n\\n---\\n\\n## Line Breaks\\n\\nHere\'s a line for us to start with.\\n\\nThis line is separated from the one above by two newlines, so it will be a _separate paragraph_.\\n\\nThis line is also a separate paragraph, but... This line is only separated by a single newline, so it\'s a separate line in the _same paragraph_.\\n\\n---\\n\\n## Admonitions\\n\\n:::note\\n\\nThis is a note\\n\\n:::\\n\\n:::tip\\n\\nThis is a tip\\n\\n:::\\n\\n:::important\\n\\nThis is important\\n\\n:::\\n\\n:::caution\\n\\nThis is a caution\\n\\n:::\\n\\n:::warning\\n\\nThis is a warning\\n\\n:::"}]}')}}]);